script: |
  super -f text -I q9898.spq | sort > q9898.out

inputs:
  - name: q9898.spq
    data: |
      SELECT ALL - col1 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT NULL IS NOT NULL OR + col0 + + - 35 + + + 1 + col0 IS NULL;
  - name: tab0

outputs:
  - name: q9898.out
    data: |
      -1
      -21
      -81
